import {
  IonApp,
  IonContent,
  IonHeader,
  IonToolbar,
  IonTitle,
  IonInput,
  IonItem,
  IonLabel,
} from '@ionic/react';
import React from 'react';

function App() {
  return (
    <IonApp>
      <IonHeader>
        <IonToolbar>
          <IonTitle>BioRhythms</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent className="ion-padding">
        <IonItem>
          <IonLabel></IonLabel>
        </IonItem>
        <IonInput placeholder="your name"/>
      </IonContent>
    </IonApp>
  );
}

export default App;
